import styled from 'styled-components';

export const Container = styled.div`
  display: block;
  min-width: 900px;

  img {
    border-radius: 50%;
    border: 3px solid rgba(255, 255, 255, 0.3);
    background: #eee;
  }
`;
export const Delete = styled.div`
  height: 4em;
  display: flex;
  align-items: center;
  justify-content: center;
`;
